import React, { useEffect } from 'react';
import '../../css/home.css';

const Home = (props) => {

  useEffect(() => {
    props.setShowFooter(true);
    document.title = "SHAREHOME - A custom party game";
  });

  return (
    <div className="content">
      <NavLink to="/"><div className="title noselect"></div></NavLink>
      <p className="subtitle">
        A custom party game inspired by Terrace House
      </p>
      <li className="callToAction">
        <a href="/play">Play virtually with friends right now!</a><span> (video conferencing not included)</span>
      </li>
      <li className="callToAction">
        <a href="/purchase">Purchase a physical copy</a><span> (when social distancing becomes lame again)</span>
      </li>
      <li className="callToAction">
        <a href="/purchase">Print a shitty paper version</a><span> (free if you have a printer)</span>
      </li>
    </div>
  );
}

export default Home;
